import React from "react";
import Clubs from "./components/clubs"



export const MarketPlace = (props) => {
  return (
    <div onClick = {() => console.log(props.profiles)}> 
      
      <Clubs addt = {props.add} profile = {props.profiles}></Clubs>
    </div>
  );
};
